html {
  scroll-behavior: smooth;
}

body {
  margin: 0;
}

.splash {
  height: 100vh;
  padding-top: 60px;
  margin: auto;
  position: relative;

  background-image: url(img/bg-img.jpg);
  background-size: cover;
  background-attachment: fixed;

  h1 {
    color: $light-font;
    margin-left: 0.5em;
    font-size: 4em;
    font-family: $txt;
    font-weight: $light;
    word-wrap: break-word;
    border-bottom: 1px whitesmoke solid;
    line-height: 2;

    position: absolute;
    top: 40%;
    transform: translateY(-40%);

    @include pb {
      font-size: 2.5em;
      margin: 0.5em;
    }

    @include ps {
      font-size: 2em;
    }
  }

  .scroll-indicator {
    position: absolute;
    left: 50%;
    font-size: 3em;
    text-decoration: none;

    -webkit-animation: bounce 1.4s infinite;
    animation: bounce 1.4s infinite;
  }

  @-webkit-keyframes bounce {
    0% {
      top: 80%;
    }
    50% {
      top: 83%;
    }
    100% {
      top: 80%;
    }
  }

  @keyframes bounce {
    0% {
      top: 80%;
    }
    50% {
      top: 83%;
    }
    100% {
      top: 80%;
    }
  }

  .fa,
  .fas {
    color: white;
  }
}
#menu {
  display: none;
}

nav {
  position: fixed;
  width: 100%;
  z-index: 2;
  text-align: right;
  padding: 1em;
  font-family: $txt;
  font-weight: $light;
  background: transparent;
  transition: 0.5s ease-in-out;

  &.nav-colored {
    background: $nav-dark;
    transition: 0.5s ease-in-out;
  }

  @include tb {
    display: none;
  }

  a {
    color: $light-font;
    text-decoration: none;
    margin: 2em;
    transform: scaleX(0);
    transition: transform 250ms ease-in-out;
    position: relative;

    &::after {
      position: absolute;
      content: "";
      transition: width 0.3s;
      display: inline-block;
      bottom: 0;
      left: 0;
      width: 0;
    }

    &:hover::after {
      width: 100%;
      transform: scaleX(1);
      border-bottom: 1px $light-font solid;
    }
  }
}

section {
  position: relative;
  h1 {
    font-family: $txt;
    font-weight: $light;
    font-size: 2.5em;
    text-align: center;
  }

  h4 {
    font-size: 9em;
    opacity: 0.1;
    font-family: $txt;
    position: absolute;
    margin: 0;
    top: -0.2em;
    left: 0.3em;
    color: $dark-font;

    @include tb {
      font-size: 6em;
    }

    @include pb {
      font-size: 4em;
    }

    @include pm {
      top: 0.3em;
      font-size: 3em;
    }
  }

  p {
    font-family: $txt;
    font-weight: $regular;
  }
}

#info {
  max-width: 60vw;
  margin: 0 auto;
  padding: 4em;

  @include pm {
    max-width: 100%;
    padding: 2em;
  }
}

#portfolio {
  border-top: 1px grey solid;
  margin: 1.5em;
  align-items: center;

  .portfolio {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    margin: 5em 1em 0em;

    p {
      padding-right: 3em;
      margin-top: 0;

      @include tb {
        max-width: 550px;
        margin: 2em 2em;
        padding: 0;
      }

      @include pb {
        margin: 2em 0em;
      }
    }

    #order-change {
      @include tb {
        order: 1;
      }
    }

    @include ll {
      grid-gap: 2em;
    }

    @include tb {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
    }
  }
  .image {
    position: relative;

    img {
      max-width: 550px;
      transition: all 0.5s ease-in-out;
      opacity: 1;
      position: relative;

      &:hover {
        transform: scale(1.03, 1.03);
        opacity: 0.3;
      }

      @include pb {
        max-width: 350px;
      }
      @include ps {
        max-width: 280px;
      }
    }

    p {
      position: absolute;
      top: 0;
      bottom: 0;
      left: 0;
      right: 0;
      background: rgba(29, 106, 154, 0.72);
      color: black;
      visibility: hidden;
      opacity: 0;
      transition: opacity 0.2s, visibility 0.2s;

      &:hover {
        opacity: 1;
      }
    }
  }
}

#contact {
  margin: 4em 1.5em;
  border-top: 1px grey solid;
  background: $nav-dark;
  color: $light-font;

  @include pb {
    margin: 0;
  }

  .contact-txt {
    max-width: 60vw;
    margin: 0 auto;

    @include pb {
      padding: 1em;
      margin: 0;
      max-width: 100%;
    }
  }

  h4 {
    color: rgb(58, 58, 58);
  }

  img {
    border-radius: 0.7em;
  }

  .contact-info {
    max-width: 60vw;
    margin: 0 auto;
    padding-top: 2em;
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    grid-gap: 2em;
    text-align: center;

    p {
      font-size: 1.2em;
    }

    @include ll {
      max-width: none;
    }

    @include tb {
      display: block;
      text-align: left;
      padding: 1em 8em;
    }

    @include pb {
      padding: 1em;
    }
  }

  .tlf:before {
    font-family: "Material Icons";
    content: "\e325";
    font-size: 1.2em;
    padding-right: 0.5em;
  }
  .mail:before {
    font-family: "Material Icons";
    content: "\e0be";
    font-size: 1.2em;
    padding-right: 0.5em;
  }
  .adress:before {
    font-family: "Material Icons";
    content: "\e88a";
    font-size: 1.2em;
    padding-right: 0.5em;
  }
}

