//Laptop
$screen-ll: 1024px;
@mixin ll {
  @media (max-width: #{$screen-ll}) {
    @content;
  }
}

//iPad
$screen-tb: 812px;
@mixin tb {
  @media (max-width: #{$screen-tb}) {
    @content;
  }
}

//iPhone 6,7,8 Plus
$screen-pb: 414px;
@mixin pb {
  @media (max-width: #{$screen-pb}) {
    @content;
  }
}

//iPhone X, 6, 7, 8
$screen-pm: 375px;
@mixin pm {
  @media (max-width: #{$screen-pm}) {
    @content;
  }
}

//iPhone 5
$screen-ps: 320px;
@mixin ps {
  @media (max-width: #{$screen-ps}) {
    @content;
  }
}

sources.styles/cv.scss:
// ScrollTo Javascript
//SCroll into view
//Indicator evt. pil-ish
//Halv-logo / helt logo p hvert firma

#about {
  display: grid;
  grid-template-columns: 1fr 3fr;
  position: relative;

  @include pb {
    display: block;
  }

  img {
    position: absolute;
    width: 400px;
    left: 6em;
    top: 6em;

    @include ll {
      left: 3em;
    }

    @include tb {
      width: 300px;
    }

    @include pb {
      position: relative;
      top: 2em;
    }
  }

  .overlap {
    background: $nav-dark;
    height: 80vh;
    padding: 10em 0em 0em 15em;
    color: $light-font;
    font-family: $txt;
    position: relative;

    @include ll {
      height: 45vh;
    }

    @include tb {
      height: 60vh;
      padding: 3em 0em 0em 13em;
    }

    @include pb {
      padding: 7em 1em 1em 1em;
    }

    @include pm {
      height: 90vh;
    }

    @include ps {
      height: 110vh;
    }

    h1 {
      font-size: 4em;
      font-weight: $light;
      text-align: left;
    }

    h2 {
      font-size: 1em;
    }

    p {
      max-width: 40vw;

      @include pb {
        max-width: 100%;
      }
    }
  }

  .scroll-indicator {
    position: absolute;
    left: 50%;
    font-size: 3em;

    text-decoration: none;
    -webkit-animation: bounce 1.4s infinite;
    animation: bounce 1.4s infinite;
  }

  @-webkit-keyframes bounce {
    0% {
      top: 80%;
    }
    50% {
      top: 83%;
    }
    100% {
      top: 80%;
    }
  }

  @keyframes bounce {
    0% {
      top: 80%;
    }
    50% {
      top: 83%;
    }
    100% {
      top: 80%;
    }
  }

  .fa,
  .fas {
    color: white;
  }
}

#resume {
  margin: 8em;
  position: relative;

  .h4-edu {
    top: 4.3em;

    @include ll {
      top: 5.3em;
    }

    @include tb {
      top: 8.3em;
    }
  }

  .h4-job {
    top: -0.4em;
  }

  h1 {
    margin: 4em 0em 2em 0em;
  }
  .cv {
    overflow: auto;
    white-space: nowrap;

    display: grid;
    grid-template-columns: repeat(5, 1fr);
    grid-gap: 2em;
    padding: 2em;
  }

  .job,
  .education {
    display: flex;
    flex-direction: column;
    text-align: left;
    padding: 1em;
    width: 30vw;
    border-radius: 1em;
    box-shadow: 1px 7px 20px grey;
    margin-right: 2em;
    transition: all 0.5s ease-in-out;

    &:hover {
      transform: scale(1.03, 1.03);
    }

    @include tb {
      white-space: normal;
      width: 40vw;
    }

    h1 {
      font-size: 1.6em;
      margin: 0;
    }

    h2 {
      font-family: $txt;
      font-weight: $bold;
      font-size: 1.2em;
      text-align: center;
    }

    h3 {
      font-family: $txt;
      font-weight: $semi-bold;
      text-align: center;
    }

    p {
      text-align: center;
    }

    ul {
      white-space: normal;
    }

    li {
      font-family: $txt;
      line-height: 2;
      max-width: 30vw;
      font-size: 0.8em;
    }

    .cv > .job:last-child {
      margin: 20em;
    }
  }

  img {
    max-width: 300px;
  }
}

.some {
  text-align: center;
  margin-top: 3em;
  img {
    width: 3em;
  }
}

@media only screen and (max-width: 414px) {
  @-webkit-keyframes bounce {
    0% {
      top: 55%;
    }
    50% {
      top: 58%;
    }
    100% {
      top: 55%;
    }
  }
  @keyframes bounce {
    0% {
      top: 55%;
    }
    50% {
      top: 58%;
    }
    100% {
      top: 55%;
    }
  }
}
